<!DOCTYPE html>
<html lang="pt-BR">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width,initial-scale=1" />
<title>SAMU192 – Nacional • APP Interativo</title>
<link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css" crossorigin="anonymous" />
<script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js" crossorigin="anonymous"></script>
<script src="https://cdn.jsdelivr.net/npm/chart.js@4.4.1/dist/chart.umd.min.js"></script>
<script src="https://unpkg.com/papaparse@5.4.1/papaparse.min.js"></script>
<link href="https://fonts.googleapis.com/css2?family=Orbitron:wght@600;700&family=Exo+2:wght@400;600&display=swap" rel="stylesheet">
<style>
  :root{
    --bg1:#050b16; --bg2:#0b1e39; --panel:#0e2444; --panel2:#0a1b33;
    --text:#e6edf7; --muted:#9fb4d1; --gold:#d4af37; --accent:#22e1ff; --accent2:#1f6feb;
  }
  *{box-sizing:border-box} body{margin:0;color:var(--text);background:radial-gradient(1000px 500px at 80% -10%,#12366f 0%,transparent 60%),linear-gradient(180deg,var(--bg2),var(--bg1));font-family:'Exo 2',sans-serif}
  .wrap{max-width:1280px;margin:0 auto;padding:24px}
  h1{font-family:'Orbitron',sans-serif;margin:0 0 10px 0;letter-spacing:.5px;text-shadow:0 0 12px rgba(34,225,255,.25)}
  .controls{display:flex;flex-wrap:wrap;gap:10px;background:linear-gradient(180deg,#102a52,#0b1e39);border:1px solid #1f3a69;border-radius:18px;padding:12px;box-shadow:0 20px 50px rgba(0,0,0,.25),inset 0 0 30px rgba(34,225,255,.06);}
  .btn,select,input{appearance:none;border:1px solid #23406e;background:#0d213e;color:var(--text);border-radius:12px;padding:10px 12px}
  .btn.accent{background:linear-gradient(180deg,#0e4aa3,#153f7f);border-color:#2e64c3}
  .grid{display:grid;gap:14px} .grid-6{grid-template-columns:repeat(6,1fr)} @media(max-width:900px){.grid-6{grid-template-columns:repeat(2,1fr)}}
  .card{background:linear-gradient(200deg,#0c1f3d,#071427);border:1px solid #1b355f;border-radius:18px;padding:12px;box-shadow:0 30px 80px rgba(0,0,0,.35),inset 0 0 30px rgba(34,225,255,.04);}
  .kpi .label{font-size:12px;color:var(--muted)} .kpi .value{font-family:'Orbitron',sans-serif;font-size:26px}
  #map{height:540px;border-radius:18px;overflow:hidden;border:1px solid #1c3866}
  nav.tabs{display:flex;gap:10px;margin:12px 0;perspective:800px}
  .tab{padding:10px 14px;border-radius:12px;background:#0a1b33;border:1px solid #223b69;cursor:pointer;transform:rotateX(15deg);transition:.25s}
  .tab.active{background:linear-gradient(180deg,#10315f,#0d2446);transform:rotateX(0) translateZ(8px);box-shadow:0 16px 40px rgba(31,111,235,.35)}
  table{width:100%;border-collapse:separate;border-spacing:0;font-size:13px} thead th{text-align:left;padding:10px;background:#0e2444;position:sticky;top:0;border-bottom:1px solid #203b6b} tbody td{padding:8px 10px;border-bottom:1px dashed #173259} .right{text-align:right}
</style>
</head>
<body>
<div class="wrap">
  <header>
    <h1>SAMU192 – Nacional • App Interativo</h1>
    <div style="opacity:.8">Mapa (polígonos), Gráficos e Abas 3D • Neon</div>
  </header>

  <section class="controls">
    <button class="btn accent" id="btnUseEmbedded">Usar dados embutidos</button>
    <label class="btn"><input id="fileInput" type="file" accept=".csv,text/csv" style="display:none" />Carregar CSV</label>
    <button class="btn" id="btnPaste">Colar CSV</button>
    <select id="selTipo"><option value="todos">Tipo: Todos</option><option>CRU</option><option>USA</option><option>USB</option><option>Moto</option><option>Aéreo</option><option>Lancha</option></select>
    <select id="selUF"><option value="todos">UF: Todas</option></select>
    <input id="inpMunicipio" placeholder="Filtrar por município..." />
    <select id="selAmazonia"><option value="todos">Amazônia: Todos</option><option value="VERDADEIRO">Somente VERDADEIRO</option><option value="FALSO">Somente FALSO</option></select>
    <select id="selStatus"><option value="todos">Status: Todos</option></select>
    <button class="btn" id="btnExport">Exportar filtro (CSV)</button>
  </section>

  <section class="grid grid-6" id="kpis"></section>

  <nav class="tabs" id="tabs">
    <div class="tab active" data-tab="mapa">Mapa (UF)</div>
    <div class="tab" data-tab="ttipo">Gráfico – Totais por Tipo</div>
    <div class="tab" data-tab="tuf">Gráfico – Totais por UF</div>
    <div class="tab" data-tab="detuf">Detalhe por UF</div>
  </nav>

  <section id="tab-contents">
    <div id="tab-mapa" class="card">
      <div style="display:flex;justify-content:space-between;align-items:center;margin-bottom:6px">
        <div style="font-weight:600">Mapa por Estado (polígonos preenchidos)</div>
        <div style="font-size:12px;color:#b7c6df">Escala por total de registros</div>
      </div>
      <div id="map"></div>
    </div>

    <div id="tab-ttipo" class="card" style="display:none">
      <canvas id="chartTipo" height="180"></canvas>
    </div>

    <div id="tab-tuf" class="card" style="display:none">
      <canvas id="chartUF" height="220"></canvas>
    </div>

    <div id="tab-detuf" class="card" style="display:none">
      <div style="margin-bottom:8px">UF selecionada: <strong id="ufSel">—</strong></div>
      <div style="max-height:420px;overflow:auto;border-radius:12px;border:1px solid #173259">
        <table id="tblMun">
          <thead><tr><th>Município</th><th>Tipo</th><th class="right">Registros</th></tr></thead>
          <tbody></tbody>
        </table>
      </div>
    </div>
  </section>
</div>

, "Status": "Qualificado"}, {"UF": "TO", "Município": "Paraíso do Tocantins", "RegSaúde": "CANTAO", "Tipo": "USB", "Gestão": "SMS", "CENTRAL DE REGULAÇÃO DAS URGÊNCIAS": "Palmas", "Amazônia Legal": "VERDADEIRO", "Status": "Qualificado"}, {"UF": "TO", "Município": "Porto Nacional", "RegSaúde": "AMOR PERFEITO", "Tipo": "USB", "Gestão": "SMS", "CENTRAL DE REGULAÇÃO DAS URGÊNCIAS": "Palmas", "Amazônia Legal": "VERDADEIRO", "Status": "Qualificado"}];
const TIPOS = ["CRU","USA","USB","Moto","Aéreo","Lancha"];
const GEOJSON_URL = "https://raw.githubusercontent.com/codeforamerica/click_that_hood/master/public/data/brazil-states.geojson";
const PALETTE = ["#22e1ff", "#d4af37", "#00e69f", "#a371f7", "#ff7b72", "#2ea043", "#ffb703", "#8ecae6", "#ff006e", "#3a86ff", "#8338ec", "#fb5607"];

let ROWS = [];
let FILTERS = { tipo:'todos', uf:'todos', municipio:'', amazonia:'todos', status:'todos' };
let SELECTED_UF = null;
let map, geoLayer, chartTipo, chartUF;

function groupBy(arr, keyFn){ const m=new Map(); arr.forEach(x=>{const k=keyFn(x); m.set(k, [...(m.get(k)||[]),x]);}); return m; }
function numberBR(n){ return (n||0).toLocaleString('pt-BR'); }
function toCSV(rows){ return Papa.unparse(rows, { quotes:true, header:true }); }

function applyFilters(){
  return ROWS.filter(r=>{
    const tOk = FILTERS.tipo==='todos' || r['Tipo']===FILTERS.tipo;
    const uOk = FILTERS.uf==='todos' || r['UF']===FILTERS.uf;
    const mOk = !FILTERS.municipio || String(r['Município']).toLowerCase().includes(FILTERS.municipio.toLowerCase());
    const aOk = FILTERS.amazonia==='todos' || String(r['Amazônia Legal']||r['AmazoniaLegal']).toUpperCase().includes(FILTERS.amazonia.toUpperCase());
    const sOk = FILTERS.status==='todos' || String(r['Status']).toLowerCase()===FILTERS.status.toLowerCase();
    return tOk && uOk && mOk && aOk && sOk;
  });
}

function renderKPIs(rows){
  const el = document.getElementById('kpis'); el.innerHTML='';
  const counts = { Total: rows.length, CRU:0, USA:0, USB:0, Moto:0, "Aéreo":0, Lancha:0 };
  rows.forEach(r=>{ if(counts[r['Tipo']]!==undefined) counts[r['Tipo']]++; });
  const items = [
    ['Total Nacional', counts.Total],
    ['Total CRU', counts.CRU],['Total USA', counts.USA],['Total USB', counts.USB],
    ['Total Moto', counts.Moto],['Total Aéreo', counts["Aéreo"]],['Total Lancha', counts.Lancha]
  ];
  items.forEach(([label,val])=>{
    const d=document.createElement('div'); d.className='card kpi';
    d.innerHTML=`<div class="label">${label}</div><div class="value">${numberBR(val)}</div>`;
    el.appendChild(d);
  });
}

function renderChartTipo(rows){
  const ctx = document.getElementById('chartTipo').getContext('2d');
  const counts = Object.fromEntries(TIPOS.map(t=>[t,0]));
  rows.forEach(r=>{ if(counts[r['Tipo']]!==undefined) counts[r['Tipo']]++; });
  const labels = TIPOS;
  const data = labels.map(l=>counts[l]||0);
  if(chartTipo) chartTipo.destroy();
  chartTipo = new Chart(ctx, {
    type:'bar',
    data:{ labels, datasets:[{ label:'Total por Tipo', data, backgroundColor: PALETTE.slice(0,labels.length) }] },
    options:{ responsive:true, plugins:{ legend:{ display:false }, tooltip:{ enabled:true } },
      scales:{ x:{ ticks:{ color:'#cfe2ff' } }, y:{ ticks:{ color:'#cfe2ff' }, beginAtZero:true } } }
  });
}

function renderChartUF(rows){
  const ctx = document.getElementById('chartUF').getContext('2d');
  const byUF = groupBy(rows, r=> r['UF']||'');
  const ufs = Array.from(byUF.keys()).filter(x=>x).sort();
  const datasets = TIPOS.map((t,i)=>({
    label:t,
    data: ufs.map(uf=> (byUF.get(uf)||[]).filter(r=>r['Tipo']===t).length ),
    backgroundColor: PALETTE[(i)%PALETTE.length]
  }));
  if(chartUF) chartUF.destroy();
  chartUF = new Chart(ctx, {
    type:'bar',
    data:{ labels: ufs, datasets },
    options:{ responsive:true, plugins:{ tooltip:{ mode:'index', intersect:false } }, scales:{
      x:{ stacked:true, ticks:{ color:'#cfe2ff', maxRotation:90, minRotation:30 } },
      y:{ stacked:true, ticks:{ color:'#cfe2ff' }, beginAtZero:true }
    } }
  });
}

async function ensureMap(){
  if(map) return;
  map = L.map('map').setView([-14.235, -51.9253], 4);
  L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', { maxZoom: 18, attribution:'&copy; OpenStreetMap' }).addTo(map);
}
function colorScale(v, max){
  const p = (v / Math.max(1,max));
  const stops = ['#1f6feb','#22e1ff','#00e69f','#ffd166','#ff006e'];
  const idx = Math.min(stops.length-2, Math.floor(p*(stops.length-1)));
  return stops[idx];
}
async function renderMap(rows){
  await ensureMap();
  if(geoLayer) geoLayer.remove();

  const byUF = groupBy(rows, r=> r['UF']||'');
  const totals = Object.fromEntries(Array.from(byUF.entries()).map(([uf, arr])=>[uf, (uf?arr.length:0)]));
  const maxV = Math.max(1, ...Object.values(totals));

  const gj = await fetch(GEOJSON_URL).then(r=>r.json());
  function ufFromFeature(feat){
    const name = (feat.properties && (feat.properties.name || feat.properties.NAME_1 || feat.properties.estado)) || '';
    const mapNameUF = {"Acre":"AC","Alagoas":"AL","Amazonas":"AM","Amapá":"AP","Bahia":"BA","Ceará":"CE","Distrito Federal":"DF","Espírito Santo":"ES","Goiás":"GO","Maranhão":"MA","Minas Gerais":"MG","Mato Grosso do Sul":"MS","Mato Grosso":"MT","Pará":"PA","Paraíba":"PB","Pernambuco":"PE","Piauí":"PI","Paraná":"PR","Rio de Janeiro":"RJ","Rio Grande do Norte":"RN","Rondônia":"RO","Roraima":"RR","Rio Grande do Sul":"RS","Santa Catarina":"SC","Sergipe":"SE","São Paulo":"SP","Tocantins":"TO"};
    return mapNameUF[name] || '';
  }

  geoLayer = L.geoJSON(gj, {
    style: function(feature){
      const uf = ufFromFeature(feature);
      const v = totals[uf] || 0;
      return {
        color: '#0ad7ff',
        weight: 1,
        fillColor: colorScale(v, maxV),
        fillOpacity: v ? 0.6 : 0.15
      };
    },
    onEachFeature: function(feature, layer){
      const uf = ufFromFeature(feature);
      const v = totals[uf] || 0;
      layer.bindTooltip(`<div class="tooltip"><strong>${uf||'—'}</strong><br/>${numberBR(v)} registros</div>`, { sticky:true });
      layer.on('click', ()=>{ SELECTED_UF = uf || null; switchTab('detuf'); renderAll(); });
    }
  }).addTo(map);
}

function renderTableMunicipio(rows){
  const tb = document.querySelector('#tblMun tbody');
  const label = document.getElementById('ufSel');
  tb.innerHTML=''; label.textContent = SELECTED_UF || '—';
  if(!SELECTED_UF) return;
  const filtroUF = rows.filter(r=> r['UF']===SELECTED_UF);
  const m = groupBy(filtroUF, r=> `${r['Município']}||${r['Tipo']}`);
  const list = Array.from(m.entries()).map(([k,arr])=>{ const [mun,tipo]=k.split('||'); return { Município:mun, Tipo:tipo, Registros:arr.length }; })
    .sort((a,b)=> a.Município.localeCompare(b.Município,'pt-BR') || a.Tipo.localeCompare(b.Tipo,'pt-BR'));
  list.forEach(row=>{ const tr=document.createElement('tr'); tr.innerHTML=`<td>${row.Município}</td><td>${row.Tipo}</td><td class="right">${numberBR(row.Registros)}</td>`; tb.appendChild(tr); });
}

const TABS = document.getElementById('tabs');
TABS.addEventListener('click', (e)=>{ const t=e.target.closest('.tab'); if(!t) return; switchTab(t.dataset.tab); });
function switchTab(name){
  [...TABS.querySelectorAll('.tab')].forEach(x=>x.classList.remove('active'));
  const btn = TABS.querySelector(`[data-tab="{name}"]`.replace("{name}", name)); if(btn) btn.classList.add('active');
  for(const el of document.querySelectorAll('#tab-contents > div')) el.style.display='none';
  document.getElementById('tab-'+name).style.display='block';
}

document.getElementById('btnExport').onclick = ()=>{ const rows=applyFilters(); const csv=toCSV(rows); const blob=new Blob([csv],{type:'text/csv;charset=utf-8;'}); const url=URL.createObjectURL(blob); const a=document.createElement('a'); a.href=url; a.download='SAMU192_filtrado.csv'; a.click(); URL.revokeObjectURL(url); };

document.getElementById('btnUseEmbedded').onclick = ()=>{ ROWS = window.SAMU_DATA || []; hydrateSelectors(); SELECTED_UF=null; renderAll(); };
const fileInput = document.getElementById('fileInput'); fileInput.onchange = (e)=>{ const f=e.target.files[0]; if(!f) return; const r=new FileReader(); r.onload=()=>{ const {data}=Papa.parse(String(r.result),{header:true,skipEmptyLines:true}); ROWS=data; hydrateSelectors(); SELECTED_UF=null; renderAll(); }; r.readAsText(f,'utf-8'); };
document.getElementById('btnPaste').onclick = async ()=>{ const text=await navigator.clipboard.readText().catch(()=> ''); if(!text) return alert('Nada para colar.'); const {data}=Papa.parse(text,{header:true,skipEmptyLines:true}); ROWS=data; hydrateSelectors(); SELECTED_UF=null; renderAll(); };

const selTipo = document.getElementById('selTipo');
const selUF = document.getElementById('selUF');
const inpMunicipio = document.getElementById('inpMunicipio');
const selAmazonia = document.getElementById('selAmazonia');
const selStatus = document.getElementById('selStatus');
selTipo.onchange = ()=>{ FILTERS.tipo = selTipo.value; renderAll(); };
selUF.onchange = ()=>{ FILTERS.uf = selUF.value; SELECTED_UF = (FILTERS.uf==='todos'? null : FILTERS.uf); renderAll(); };
inpMunicipio.oninput = ()=>{ FILTERS.municipio = inpMunicipio.value; renderAll(); };
selAmazonia.onchange = ()=>{ FILTERS.amazonia = selAmazonia.value; renderAll(); };
selStatus.onchange = ()=>{ FILTERS.status = selStatus.value; renderAll(); };

function hydrateSelectors(){
  const sUF = new Set(); (ROWS||[]).forEach(r=> r['UF'] && sUF.add(r['UF']));
  selUF.innerHTML = '<option value="todos">UF: Todas</option>' + Array.from(sUF).sort().map(u=>`<option>${u}</option>`).join('');
  const sSt = new Set(); (ROWS||[]).forEach(r=> r['Status'] && sSt.add(r['Status']));
  selStatus.innerHTML = '<option value="todos">Status: Todos</option>' + Array.from(sSt).sort().map(s=>`<option>${s}</option>`).join('');
}

async function renderAll(){
  const rows = applyFilters();
  renderKPIs(rows);
  await renderMap(rows);
  renderChartTipo(rows);
  renderChartUF(rows);
  renderTableMunicipio(rows);
}

document.getElementById('btnUseEmbedded').click();
</script>
</body>
</html>
